import React, { Component } from "react";
import { WriterWrapper } from "../style";

class Writer extends Component {
  render() {
    return (
      <WriterWrapper>
        <img src="" alt="" />
        <div className="info">123</div>
      </WriterWrapper>
    );
  }
}

export default Writer;
